import ExpenseItem from '../ExpenseItem/ExpenseItem';
import * as S from './Expense.style';
import Card from '../Card';

const Expense = (props) => {
    const { expenses } = props;
    return (
        <S.ExpenseWrapper>
          {expenses.map(expense => (
            <ExpenseItem 
              title={expense.title}
              amount={expense.amount}
              date={expense.date}
            />
          ))}
        </S.ExpenseWrapper>
    );
}

export default Expense;
